    true,nt"url": null,nt"notes": "The Research and Development Information
    System (RDIS) is the Veterans Affairs Central Office budgetary and project data
    repository for managing the VA Research and Development Program. The RDIS contains
    data collected from Veterans Affairs Medical Centers (VAMCs) on all VA research
    projects. It stores information on VAMC investigators, project budget allocations
    and expenditures, initial project abstracts, progress reports and research space.
    VA Medical Centers collect and submit the data using an application called electronic
    Project Management and Information System (ePROMISE). That data is submitted to
    Veterans Affairs Central Office and becomes a component of RDIS. ePROMISE collects
    data from over 150 VA facilities (including 75 VAMCs). VA funded, non-VA funded
    and non-funded research proposals are reviewed and must be approved by the Research
    and Development (R&D) Committee and relevant R&D Subcommittees (Human Studies, Animal
    Use, and/or Biosafety) at each VAMC. Basic information on research projects approved
    by the VAMC Research and Development committee is transmitted to the RDIS, which
    tracks the life cycle of these projects.",nt"license_title": "Creative Commons
